static void adpt_i2o_post_wait_complete(u32 context, int status)
{
	struct adpt_i2o_post_wait_data *p1 = NULL;
	context &= 0x7fff;
	spin_lock(&adpt_post_wait_lock);
	for(p1 = adpt_post_wait_queue; p1; p1 = p1->next) {
		if(p1->id == context) {
			p1->status = status;
			spin_unlock(&adpt_post_wait_lock);
			wake_up_interruptible(p1->wq);
			return;
		}
	}
	spin_unlock(&adpt_post_wait_lock);
	printk(KERN_DEBUG"dpti: Could Not find task %d in wait queue\n",context);
	printk(KERN_DEBUG"      Tasks in wait queue:\n");
	for(p1 = adpt_post_wait_queue; p1; p1 = p1->next) {
		printk(KERN_DEBUG"           %d\n",p1->id);
	}
	return;
}

static int asf_read_marker(AVFormatContext *s, int64_t size)
{
    AVIOContext *pb = s->pb;
    ASFContext *asf = s->priv_data;
    int i, count, name_len, ret;
    char name[1024];
    avio_rl64(pb);            
    avio_rl64(pb);            
    count = avio_rl32(pb);    
    avio_rl16(pb);            
    name_len = avio_rl16(pb); 
    for (i = 0; i < name_len; i++)
        avio_r8(pb); 
    for (i = 0; i < count; i++) {
        int64_t pres_time;
        int name_len;
        avio_rl64(pb);             
        pres_time = avio_rl64(pb); 
        pres_time -= asf->hdr.preroll * 10000;
        avio_rl16(pb);             
        avio_rl32(pb);             
        avio_rl32(pb);             
        name_len = avio_rl32(pb);  
        if ((ret = avio_get_str16le(pb, name_len * 2, name,
                                    sizeof(name))) < name_len)
            avio_skip(pb, name_len - ret);
        avpriv_new_chapter(s, i, (AVRational) { 1, 10000000 }, pres_time,
                           AV_NOPTS_VALUE, name);
    }
    return 0;
}

QPDF::resolve(int objid, int generation)
{
    QPDFObjGen og(objid, generation);
    if (this->resolving.count(og))
    {
	QTC::TC("qpdf", "QPDF recursion loop in resolve");
	warn(QPDFExc(qpdf_e_damaged_pdf, this->file->getName(),
		     "", this->file->getLastOffset(),
		     "loop detected resolving object " +
		     QUtil::int_to_string(objid) + " " +
		     QUtil::int_to_string(generation)));
        return new QPDF_Null;
    }
    ResolveRecorder rr(this, og);
    if (! this->obj_cache.count(og))
    {
	if (! this->xref_table.count(og))
	{
	    return new QPDF_Null;
	}
	QPDFXRefEntry const& entry = this->xref_table[og];
	switch (entry.getType())
	{
	  case 1:
	    {
		qpdf_offset_t offset = entry.getOffset();
		int aobjid;
		int ageneration;
		QPDFObjectHandle oh =
		    readObjectAtOffset(true, offset, "", objid, generation,
				       aobjid, ageneration);
	    }
	    break;
	  case 2:
	    resolveObjectsInStream(entry.getObjStreamNumber());
	    break;
	  default:
	    throw QPDFExc(qpdf_e_damaged_pdf, this->file->getName(), "", 0,
			  "object " +
			  QUtil::int_to_string(objid) + "/" +
			  QUtil::int_to_string(generation) +
			  " has unexpected xref entry type");
	}
    }
    return this->obj_cache[og].object;
}

