void TightDecoder::FilterGradient(const rdr::U8* inbuf,
                                  const PixelFormat& pf, PIXEL_T* outbuf,
                                  int stride, const Rect& r)
{
  int x, y, c;
  static rdr::U8 prevRow[TIGHT_MAX_WIDTH*3];
  static rdr::U8 thisRow[TIGHT_MAX_WIDTH*3];
  rdr::U8 pix[3]; 
  int est[3]; 
  memset(prevRow, 0, sizeof(prevRow));
  int rectHeight = r.height();
  int rectWidth = r.width();
  for (y = 0; y < rectHeight; y++) {
    pf.rgbFromBuffer(pix, &inbuf[y*rectWidth], 1);
    for (c = 0; c < 3; c++)
      pix[c] += prevRow[c];
    memcpy(thisRow, pix, sizeof(pix));
    pf.bufferFromRGB((rdr::U8*)&outbuf[y*stride], pix, 1);
    for (x = 1; x < rectWidth; x++) {
      for (c = 0; c < 3; c++) {
        est[c] = prevRow[x*3+c] + pix[c] - prevRow[(x-1)*3+c];
        if (est[c] > 255) {
          est[c] = 255;
        } else if (est[c] < 0) {
          est[c] = 0;
        }
      }
      pf.rgbFromBuffer(pix, &inbuf[y*rectWidth+x], 1);
      for (c = 0; c < 3; c++)
        pix[c] += est[c];
      memcpy(&thisRow[x*3], pix, sizeof(pix));
      pf.bufferFromRGB((rdr::U8*)&outbuf[y*stride+x], pix, 1);
    }
    memcpy(prevRow, thisRow, sizeof(prevRow));
  }
}

static int mount_autodev(const char *name, const struct lxc_rootfs *rootfs, const char *lxcpath)
{
	int ret;
	size_t clen;
	char *path;
	INFO("Mounting container /dev");
	clen = (rootfs->path ? strlen(rootfs->mount) : 0) + 9;
	path = alloca(clen);
	ret = snprintf(path, clen, "%s/dev", rootfs->path ? rootfs->mount : "");
	if (ret < 0 || ret >= clen)
		return -1;
	if (!dir_exists(path)) {
		WARN("No /dev in container.");
		WARN("Proceeding without autodev setup");
		return 0;
	}
	if (mount("none", path, "tmpfs", 0, "size=100000,mode=755")) {
		SYSERROR("Failed mounting tmpfs onto %s\n", path);
		return false;
	}
	INFO("Mounted tmpfs onto %s",  path);
	ret = snprintf(path, clen, "%s/dev/pts", rootfs->path ? rootfs->mount : "");
	if (ret < 0 || ret >= clen)
		return -1;
	if (!dir_exists(path)) {
		ret = mkdir(path, S_IRWXU | S_IRGRP | S_IXGRP | S_IROTH | S_IXOTH);
		if (ret) {
			SYSERROR("Failed to create /dev/pts in container");
			return -1;
		}
	}
	INFO("Mounted container /dev");
	return 0;
}

njs_string_alloc(njs_vm_t *vm, njs_value_t *value, uint64_t size,
    uint64_t length)
{
    uint32_t      total, map_offset, *map;
    njs_string_t  *string;
    if (njs_slow_path(size > NJS_STRING_MAX_LENGTH)) {
        njs_range_error(vm, "invalid string length");
        return NULL;
    }
    value->type = NJS_STRING;
    njs_string_truth(value, size);
    if (size <= NJS_STRING_SHORT) {
        value->short_string.size = size;
        value->short_string.length = length;
        return value->short_string.start;
    }
    value->short_string.size = NJS_STRING_LONG;
    value->short_string.length = 0;
    value->long_string.external = 0;
    value->long_string.size = size;
    if (size != length && length > NJS_STRING_MAP_STRIDE) {
        map_offset = njs_string_map_offset(size);
        total = map_offset + njs_string_map_size(length);
    } else {
        map_offset = 0;
        total = size;
    }
    string = njs_mp_alloc(vm->mem_pool, sizeof(njs_string_t) + total);
    if (njs_fast_path(string != NULL)) {
        value->long_string.data = string;
        string->start = (u_char *) string + sizeof(njs_string_t);
        string->length = length;
        string->retain = 1;
        if (map_offset != 0) {
            map = (uint32_t *) (string->start + map_offset);
            map[0] = 0;
        }
        return string->start;
    }
    njs_memory_error(vm);
    return NULL;
}

