  handler1->expectEOM([&] {
      handler1->sendReplyWithBody(200, 100);
      handler2->sendReplyWithBody(200, 100);
    });
  handler1->expectDetachTransaction();
  handler2->expectDetachTransaction();
  flushRequestsAndLoop();
  gracefulShutdown();
}

std::string encodeBase64(const std::string& input) {
