static struct ast_sip_endpoint *transport_identify(pjsip_rx_data *rdata)
{
	char buffer[PJ_INET6_ADDRSTRLEN];
	pj_status_t status;
	struct ast_sockaddr_with_tp addr_with_tp = { { { 0, } }, };
	union pj_sockaddr sock = rdata->tp_info.transport->local_addr;
	pj_ansi_strxcpy(addr_with_tp.tp, rdata->tp_info.transport->type_name, sizeof(addr_with_tp.tp));
	if (sock.addr.sa_family == PJ_AF_INET6) {
		status = pj_inet_ntop(PJ_AF_INET6, &(sock.ipv6.sin6_addr), buffer, PJ_INET6_ADDRSTRLEN);
		if (status == PJ_SUCCESS && !strcmp(buffer, "::")) {
			ast_log(LOG_WARNING, "Matching against '::' may be unpredictable.\n");
		}
	} else {
		status = pj_inet_ntop(PJ_AF_INET, &(sock.ipv4.sin_addr), buffer, PJ_INET_ADDRSTRLEN);
		if (status == PJ_SUCCESS && !strcmp(buffer, "0.0.0.0")) {
			ast_log(LOG_WARNING, "Matching against '0.0.0.0' may be unpredictable.\n");
		}
	}
	if (status == PJ_SUCCESS) {
		ast_sockaddr_parse(&addr_with_tp.addr, buffer, PARSE_PORT_FORBID);
		ast_sockaddr_set_port(&addr_with_tp.addr, rdata->tp_info.transport->local_name.port);
		return common_identify(ip_identify_match_check, &addr_with_tp);
	} else {
		return NULL;
	}
}

void SMsgReader::readExtendedClipboard(rdr::S32 len)
{
  rdr::U32 flags;
  rdr::U32 action;
  if (len < 4)
    throw Exception("Invalid extended clipboard message");
  if (len > maxCutText) {
    vlog.error("Extended clipboard message too long (%d bytes) - ignoring", len);
    is->skip(len);
    return;
  }
  flags = is->readU32();
  action = flags & clipboardActionMask;
  if (action & clipboardCaps) {
    int i;
    size_t num;
    rdr::U32 lengths[16];
    num = 0;
    for (i = 0;i < 16;i++) {
      if (flags & (1 << i))
        num++;
    }
    if (len < (rdr::S32)(4 + 4*num))
      throw Exception("Invalid extended clipboard message");
    num = 0;
    for (i = 0;i < 16;i++) {
      if (flags & (1 << i))
        lengths[num++] = is->readU32();
    }
    handler->handleClipboardCaps(flags, lengths);
  } else if (action == clipboardProvide) {
    rdr::ZlibInStream zis;
    int i;
    size_t num;
    size_t lengths[16];
    rdr::U8* buffers[16];
    zis.setUnderlying(is, len - 4);
    num = 0;
    for (i = 0;i < 16;i++) {
      if (!(flags & 1 << i))
        continue;
      lengths[num] = zis.readU32();
      if (lengths[num] > (size_t)maxCutText) {
        vlog.error("Extended clipboard data too long (%d bytes) - ignoring",
                   (unsigned)lengths[num]);
        zis.skip(lengths[num]);
        flags &= ~(1 << i);
        continue;
      }
      buffers[num] = new rdr::U8[lengths[num]];
      zis.readBytes(buffers[num], lengths[num]);
      num++;
    }
    zis.removeUnderlying();
    handler->handleClipboardProvide(flags, lengths, buffers);
    num = 0;
    for (i = 0;i < 16;i++) {
      if (!(flags & 1 << i))
        continue;
      delete [] buffers[num++];
    }
  } else {
    switch (action) {
    case clipboardRequest:
      handler->handleClipboardRequest(flags);
      break;
    case clipboardPeek:
      handler->handleClipboardPeek(flags);
      break;
    case clipboardNotify:
      handler->handleClipboardNotify(flags);
      break;
    default:
      throw Exception("Invalid extended clipboard action");
    }
  }
}

int tipc_nl_publ_dump(struct sk_buff *skb, struct netlink_callback *cb)
{
	int err;
	u32 tsk_portid = cb->args[0];
	u32 last_publ = cb->args[1];
	u32 done = cb->args[2];
	struct net *net = sock_net(skb->sk);
	struct tipc_sock *tsk;
	if (!tsk_portid) {
		struct nlattr **attrs;
		struct nlattr *sock[TIPC_NLA_SOCK_MAX + 1];
		err = tipc_nlmsg_parse(cb->nlh, &attrs);
		if (err)
			return err;
		if (!attrs[TIPC_NLA_SOCK])
			return -EINVAL;
		err = nla_parse_nested(sock, TIPC_NLA_SOCK_MAX,
				       attrs[TIPC_NLA_SOCK],
				       tipc_nl_sock_policy);
		if (err)
			return err;
		if (!sock[TIPC_NLA_SOCK_REF])
			return -EINVAL;
		tsk_portid = nla_get_u32(sock[TIPC_NLA_SOCK_REF]);
	}
	if (done)
		return 0;
	tsk = tipc_sk_lookup(net, tsk_portid);
	if (!tsk)
		return -EINVAL;
	lock_sock(&tsk->sk);
	err = __tipc_nl_list_sk_publ(skb, cb, tsk, &last_publ);
	if (!err)
		done = 1;
	release_sock(&tsk->sk);
	sock_put(&tsk->sk);
	cb->args[0] = tsk_portid;
	cb->args[1] = last_publ;
	cb->args[2] = done;
	return skb->len;
}

