njs_function_prototype_apply(njs_vm_t *vm, njs_value_t *args, njs_uint_t nargs,
    njs_index_t unused)
{
    int64_t         i, length;
    njs_int_t       ret;
    njs_frame_t     *frame;
    njs_value_t     *this, *arr_like;
    njs_array_t     *arr;
    njs_function_t  *func;
    if (!njs_is_function(njs_argument(args, 0))) {
        njs_type_error(vm, "\"this\" argument is not a function");
        return NJS_ERROR;
    }
    func = njs_function(njs_argument(args, 0));
    this = njs_arg(args, nargs, 1);
    arr_like = njs_arg(args, nargs, 2);
    if (njs_is_null_or_undefined(arr_like)) {
        length = 0;
        goto activate;
    } else if (njs_is_array(arr_like)) {
        arr = arr_like->data.u.array;
        args = arr->start;
        length = arr->length;
        goto activate;
    } else if (njs_slow_path(!njs_is_object(arr_like))) {
        njs_type_error(vm, "second argument is not an array-like object");
        return NJS_ERROR;
    }
    ret = njs_object_length(vm, arr_like, &length);
    if (njs_slow_path(ret != NJS_OK)) {
        return ret;
    }
    arr = njs_array_alloc(vm, 1, length, NJS_ARRAY_SPARE);
    if (njs_slow_path(arr == NULL)) {
        return NJS_ERROR;
    }
    args = arr->start;
    for (i = 0; i < length; i++) {
        ret = njs_value_property_i64(vm, arr_like, i, &args[i]);
        if (njs_slow_path(ret == NJS_ERROR)) {
            return ret;
        }
    }
activate:
    vm->top_frame->skip = 1;
    frame = (njs_frame_t *) vm->top_frame;
    ret = njs_function_frame(vm, func, this, args, length, 0);
    if (njs_slow_path(ret != NJS_OK)) {
        return ret;
    }
    ret = njs_function_frame_invoke(vm, frame->native.retval);
    if (njs_slow_path(ret != NJS_OK)) {
        return ret;
    }
    return NJS_DECLINED;
}

para_macro_process(uschar *p, uschar *q)
{
int length = q - p;
argstr **pp;
macrodef *md;
macroexe *me;
for (md = macrolist; md != NULL; md = md->next)
  {
  if (length == md->namelength && Ustrncmp(p, md->name, length) == 0) break;
  }
if (md == NULL)
  {
  error(23, length, p);
  (void)fprintf(outfile, "&");
  return p;
  }
me = misc_malloc(sizeof(macroexe));
me->prev = macrocurrent;
macrocurrent = me;
me->macro = md;
me->nextline = md->lines;
if (from_type_ptr >= FROM_TYPE_STACKSIZE - 1) error(32);  
from_type[++from_type_ptr] = FROM_MACRO;
me->args = NULL;
pp = &(me->args);
while (isspace(*(++q)));
while (*q != 0 && *q != ')')
  {
  argstr *as = misc_malloc(sizeof(argstr));
  as->next = NULL;
  *pp = as;
  pp = &(as->next);
  as->string = misc_readitem(q, US",)", &length, NULL, 0);
  q += length;
  if (*q == ',') while (isspace(*(++q)));
  }
if (*q != ')')
  {
  error(24, p);
  (void)fprintf(outfile, "&");
  return p;
  }
para_inline_macro++;
for (;;)
  {
  uschar buffer[INBUFFSIZE];
  read_process_macroline(macrocurrent->nextline->string, buffer);
  if (*buffer == '.')
    {
    dot_process(buffer);
    if (macrocurrent != me) break;
    }
  else
    {
    uschar *qq = buffer + Ustrlen(buffer);
    while (qq > buffer && isspace(qq[-1])) qq--;
    *qq = 0;
    para_process(buffer);
    }
  macrocurrent->nextline = macrocurrent->nextline->next;
  if (macrocurrent->nextline == NULL)
    {
    macroexe *temp = macrocurrent;
    macrocurrent = macrocurrent->prev;
    macro_free(temp);
    from_type_ptr--;
    break;
    }
  }
para_inline_macro--;
return q + 1;
}

static int ati_remote2_probe(struct usb_interface *interface, const struct usb_device_id *id)
{
	struct usb_device *udev = interface_to_usbdev(interface);
	struct usb_host_interface *alt = interface->cur_altsetting;
	struct ati_remote2 *ar2;
	int r;
	if (alt->desc.bInterfaceNumber)
		return -ENODEV;
	ar2 = kzalloc(sizeof (struct ati_remote2), GFP_KERNEL);
	if (!ar2)
		return -ENOMEM;
	ar2->udev = udev;
	ar2->intf[0] = interface;
	ar2->ep[0] = &alt->endpoint[0].desc;
	ar2->intf[1] = usb_ifnum_to_if(udev, 1);
	r = usb_driver_claim_interface(&ati_remote2_driver, ar2->intf[1], ar2);
	if (r)
		goto fail1;
	alt = ar2->intf[1]->cur_altsetting;
	ar2->ep[1] = &alt->endpoint[0].desc;
	r = ati_remote2_urb_init(ar2);
	if (r)
		goto fail2;
	ar2->channel_mask = channel_mask;
	ar2->mode_mask = mode_mask;
	r = ati_remote2_setup(ar2, ar2->channel_mask);
	if (r)
		goto fail2;
	usb_make_path(udev, ar2->phys, sizeof(ar2->phys));
	strlcat(ar2->phys, "/input0", sizeof(ar2->phys));
	strlcat(ar2->name, "ATI Remote Wonder II", sizeof(ar2->name));
	r = sysfs_create_group(&udev->dev.kobj, &ati_remote2_attr_group);
	if (r)
		goto fail2;
	r = ati_remote2_input_init(ar2);
	if (r)
		goto fail3;
	usb_set_intfdata(interface, ar2);
	interface->needs_remote_wakeup = 1;
	return 0;
 fail3:
	sysfs_remove_group(&udev->dev.kobj, &ati_remote2_attr_group);
 fail2:
	ati_remote2_urb_cleanup(ar2);
	usb_driver_release_interface(&ati_remote2_driver, ar2->intf[1]);
 fail1:
	kfree(ar2);
	return r;
}

