static void clamp_buffer(void*& buffer, size_t& size, void* limit_start, void* limit_end)
{
	if (NULL == limit_start || NULL == limit_end)
		return;
	uint8_t* _buffer = (uint8_t*)buffer;
	uint8_t* _limit_start = (uint8_t*)limit_start;
	uint8_t* _limit_end = (uint8_t*)limit_end;
	if (_buffer > _limit_end)
	{
		buffer = limit_end;
		size = 0;
		return;
	}
	if (_buffer < _limit_start)
		_buffer = _limit_start;
	if ((_buffer + size) > _limit_end)
		size = (_limit_end - _buffer);
}

static int _process_tokenize(mcp_parser_t *pr, const size_t max) {
    const char *s = pr->request;
    int len = pr->reqlen - 2;
    if (len > PARSER_MAXLEN) {
        len = PARSER_MAXLEN;
    }
    const char *end = s + len;
    int curtoken = 0;
    int state = 0;
    while (s != end) {
        switch (state) {
            case 0:
                if (*s != ' ') {
                    pr->tokens[curtoken] = s - pr->request;
                    if (++curtoken == max) {
                        s++;
                        state = 2;
                        break;
                    }
                    state = 1;
                }
                s++;
                break;
            case 1:
                if (*s != ' ') {
                    s++;
                } else {
                    state = 0;
                }
                break;
            case 2:
                if (*s == ' ') {
                    goto endloop;
                }
                s++;
                break;
        }
    }
endloop:
    pr->tokens[curtoken] = s - pr->request;
    pr->ntokens = curtoken;
    P_DEBUG("%s: cur_tokens: %d\n", __func__, curtoken);
    return 0;
}

static void tcp_dsack_set(struct sock *sk, u32 seq, u32 end_seq)
{
	struct tcp_sock *tp = tcp_sk(sk);
	if (tcp_is_sack(tp) && sysctl_tcp_dsack) {
		int mib_idx;
		if (before(seq, tp->rcv_nxt))
			mib_idx = LINUX_MIB_TCPDSACKOLDSENT;
		else
			mib_idx = LINUX_MIB_TCPDSACKOFOSENT;
		NET_INC_STATS_BH(sock_net(sk), mib_idx);
		tp->rx_opt.dsack = 1;
		tp->duplicate_sack[0].start_seq = seq;
		tp->duplicate_sack[0].end_seq = end_seq;
	}
}

