boost::optional<SaplingOutgoingPlaintext> SaplingOutgoingPlaintext::decrypt(
    const SaplingOutCiphertext &ciphertext,
    const uint256& ovk,
    const uint256& cv,
    const uint256& cm,
    const uint256& epk
)
{
    auto pt = AttemptSaplingOutDecryption(ciphertext, ovk, cv, cm, epk);
    if (!pt) {
        return boost::none;
    }
    CDataStream ss(SER_NETWORK, PROTOCOL_VERSION);
    ss << pt.get();
    SaplingOutgoingPlaintext ret;
    ss >> ret;
    assert(ss.size() == 0);
    return ret;
}

jsi_wsGetHeaders(jsi_wsPss *pss, struct lws *wsi, Jsi_DString* dStr, int lens[], int hmax)
{
    int n = 0, i = 0, nlen;
    char buf[1000];
    const char *cp;
    while ((cp = (char*)lws_token_to_string((enum lws_token_indexes)n))) {
        int len = lws_hdr_copy(wsi, buf, sizeof(buf), ( enum lws_token_indexes)n);
        n++;
        if (i>=(n*2+2)) break;
        if (len<=0) continue;
        buf[sizeof(buf)-1] = 0;
        if (!buf[0]) continue;
        nlen = Jsi_Strlen(cp);
        if (nlen>0 && cp[nlen-1]==' ') nlen--;
        if (nlen>0 && cp[nlen-1]==':') nlen--;
        Jsi_DSAppendLen(dStr, cp, nlen);
        Jsi_DSAppend(dStr, "=", buf, "\n", NULL);
        if (lens) {
            lens[i++] = nlen;
            lens[i++] = Jsi_Strlen(buf);
        }
    }
    return i;
}

void Phase2() final {
	Local<Context> context_handle = Deref(context);
	Context::Scope context_scope{context_handle};
	Local<Value> key_inner = key->CopyInto();
	Local<Object> object = Local<Object>::Cast(Deref(reference));
	bool allow = [&]() {
		if (!inherit) {
			if (key_inner->IsName()) {
				return Unmaybe(object->HasRealNamedProperty(context_handle, key_inner.As<Name>()));
			} else if (key_inner->IsNumber()) {
				return Unmaybe(object->HasRealIndexedProperty(context_handle, HandleCast<uint32_t>(key_inner)));
			} else {
				return false;
			}
		}
		return true;
	}();
	Local<Value> value = allow ?
		Unmaybe(object->Get(context_handle, key_inner)) :
		Undefined(Isolate::GetCurrent()).As<Value>();
	ret = TransferOut(value, options);
}

static x3f_huffnode_t *new_node(x3f_hufftree_t *tree)
{
	if (tree->free_node_index >= tree->total_node_index)
		throw LIBRAW_EXCEPTION_IO_CORRUPT;
  x3f_huffnode_t *t = &tree->nodes[tree->free_node_index];
  t->branch[0] = NULL;
