void Compute(OpKernelContext* context) override {
  const Tensor& filter = context->input(1);
  const TensorShape& filter_shape = filter.shape();
  const Tensor& out_backprop = context->input(2);
  const TensorShape& out_backprop_shape = out_backprop.shape();
  TensorShape input_shape;
  if (takes_shape_) {
    const Tensor& input_sizes = context->input(0);
    OP_REQUIRES_OK(context, tensor::MakeShape(input_sizes, &input_shape));
  } else {
    input_shape = context->input(0).shape();
  }
  OP_REQUIRES(context, input_shape.dims() == 5,
              errors::InvalidArgument("input tensor must have 5 dimensions"));
  OP_REQUIRES(
      context, filter_shape.dims() == 5,
      errors::InvalidArgument("filter_sizes tensor must have 5 dimensions"));
  OP_REQUIRES(
      context, out_backprop_shape.dims() == 5,
      errors::InvalidArgument("out_backprop tensor must have 5 dimensions"));
  OP_REQUIRES(
      context, input_shape.dim_size(4) == filter_shape.dim_size(3),
      errors::InvalidArgument("input and filter_sizes must have the same "
                              "number of channels. Got ",
                              input_shape.dim_size(4), " for input and ",
                              filter_shape.dim_size(3), " for filter_sizes"));
  OP_REQUIRES(
      context, out_backprop_shape.dim_size(4) == filter_shape.dim_size(4),
      errors::InvalidArgument("out_backprop and filter_sizes must have the "
                              "same number of channels. Got ",
                              out_backprop_shape.dim_size(4),
                              " for out_backprop and ",
                              filter_shape.dim_size(4), " for filter_sizes"));
  ConvBackpropDimensions dims;
  OP_REQUIRES_OK(context, ConvBackpropComputeDimensions(
                              "Conv3DBackpropInputOp", 3,
                              input_shape, filter_shape, out_backprop_shape,
                              stride_, padding_, data_format_, &dims));
  Tensor* in_backprop;
  OP_REQUIRES_OK(context,
                 context->allocate_output(0, input_shape, &in_backprop));
  functor::CuboidConvolutionBackwardInput<Device, T>()(
      context->eigen_device<Device>(),
      in_backprop->tensor<T, 5>(),                     
      filter.tensor<T, 5>(),                           
      out_backprop.tensor<T, 5>(),                     
      static_cast<int>(dims.spatial_dims[0].stride),   
      static_cast<int>(dims.spatial_dims[1].stride),   
      static_cast<int>(dims.spatial_dims[2].stride));  
}

hstoreArrayToPairs(ArrayType *a, int *npairs)
{
	Datum	   *key_datums;
	bool	   *key_nulls;
	int			key_count;
	Pairs	   *key_pairs;
	int			bufsiz;
	int			i,
				j;
	deconstruct_array(a,
					  TEXTOID, -1, false, 'i',
					  &key_datums, &key_nulls, &key_count);
	if (key_count == 0)
	{
		*npairs = 0;
		return NULL;
	}
	if (key_count > MaxAllocSize / sizeof(Pairs))
		ereport(ERROR,
				(errcode(ERRCODE_PROGRAM_LIMIT_EXCEEDED),
			  errmsg("number of pairs (%d) exceeds the maximum allowed (%d)",
					 key_count, (int) (MaxAllocSize / sizeof(Pairs)))));
	key_pairs = palloc(sizeof(Pairs) * key_count);
	for (i = 0, j = 0; i < key_count; i++)
	{
		if (!key_nulls[i])
		{
			key_pairs[j].key = VARDATA(key_datums[i]);
			key_pairs[j].keylen = VARSIZE(key_datums[i]) - VARHDRSZ;
			key_pairs[j].val = NULL;
			key_pairs[j].vallen = 0;
			key_pairs[j].needfree = 0;
			key_pairs[j].isnull = 1;
			j++;
		}
	}
	*npairs = hstoreUniquePairs(key_pairs, j, &bufsiz);
	return key_pairs;
}

static void mdbEvalSetColumnJSON(MyDbEvalContext *p, int iCol, Jsi_DString *dStr) {
    Jsi_Interp *interp = p->jdb->interp;
    char nbuf[200];
    MysqlPrep *prep = p->prep;
    SqlFieldResults *field = prep->fieldResult+iCol;
    if (field->isnull) {
        Jsi_DSAppend(dStr, "null", NULL);
        return;
    }
    const char *zBlob = "";
    int bytes = 0;
    switch(field->jsiTypeMap) {
        case JSI_OPTION_BOOL: {
            snprintf(nbuf, sizeof(nbuf), "%s", field->buffer.vchar?"true":"false");
            Jsi_DSAppend(dStr, nbuf, NULL);
            return;
        }
        case JSI_OPTION_INT64: {
            snprintf(nbuf, sizeof(nbuf), "%lld", field->buffer.vlonglong);
            Jsi_DSAppend(dStr, nbuf, NULL);
            return;
        }
        case JSI_OPTION_DOUBLE: {
            Jsi_NumberToString(interp, field->buffer.vdouble, nbuf, sizeof(nbuf));
            Jsi_DSAppend(dStr, nbuf, NULL);
            return;
        }
        case JSI_OPTION_TIME_D:
        case JSI_OPTION_TIME_W: {
            Jsi_Number jtime = mdbMyTimeToJS(&field->buffer.timestamp);
            Jsi_NumberToString(interp, jtime, nbuf, sizeof(nbuf));
            Jsi_DSAppend(dStr, nbuf, NULL);
            return;
        }
        case JSI_OPTION_STRING:
            zBlob = field->buffer.vstring;
        default:
        {
            if( !zBlob ) {
                Jsi_DSAppend(dStr, "null", NULL);
                return;
            }
            Jsi_JSONQuote(interp, zBlob, bytes, dStr);
            return;
        }
    }
}

