int dsOpen(void) {
    struct stat sb;
    int retval;
    char *path = server.diskstore_path;
    if ((retval = stat(path,&sb) == -1) && errno != ENOENT) {
        redisLog(REDIS_WARNING, "Error opening disk store at %s: %s",
                path, strerror(errno));
        return REDIS_ERR;
    }
    if (retval == 0 && S_ISDIR(sb.st_mode)) return REDIS_OK;
    if (retval == 0 && !S_ISDIR(sb.st_mode)) {
        redisLog(REDIS_WARNING,"Disk store at %s is not a directory", path);
        return REDIS_ERR;
    }
    if (mkdir(path) == -1) {
        redisLog(REDIS_WARNING,"Disk store init failed creating dir %s: %s",
            path, strerror(errno));
        return REDIS_ERR;
    }
    return REDIS_OK;
}

int removeifnotchanged(const file_t *file, char **errorstring)
{
  int result;
  struct stat st;
  static char *filechanged = "File contents changed during processing";
  static char *unknownerror = "Unknown error";
  stat(file->d_name, &st);
  if (file->device != st.st_dev ||
      file->inode != st.st_ino ||
      file->ctime != st.st_ctime ||
      file->mtime != st.st_mtime ||
      file->size != st.st_size)
  {
    if (errorstring != 0)
        *errorstring = filechanged;
    return -2;
  }
  else
  {
    result = remove(file->d_name);
    if (result != 0 && errorstring != 0)
    {
      *errorstring = strerror(errno);
      if (*errorstring == 0)
        *errorstring = unknownerror;
    }
    return result;
  }
}

int CServer::SendMsg(CMsgPacker *pMsg, int Flags, int ClientID)
{
	CNetChunk Packet;
	if(!pMsg)
		return -1;
	if(0 <= ClientID && ClientID < MAX_CLIENTS && GameServer()->IsClientBot(ClientID))
		return 0;
	mem_zero(&Packet, sizeof(CNetChunk));
	Packet.m_ClientID = ClientID;
	Packet.m_pData = pMsg->Data();
	Packet.m_DataSize = pMsg->Size();
	if(Flags&MSGFLAG_VITAL)
		Packet.m_Flags |= NETSENDFLAG_VITAL;
	if(Flags&MSGFLAG_FLUSH)
		Packet.m_Flags |= NETSENDFLAG_FLUSH;
	if(!(Flags&MSGFLAG_NORECORD))
		m_DemoRecorder.RecordMessage(pMsg->Data(), pMsg->Size());
	if(!(Flags&MSGFLAG_NOSEND))
	{
		if(ClientID == -1)
		{
			int i;
			for(i = 0; i < MAX_CLIENTS; i++)
				if(m_aClients[i].m_State == CClient::STATE_INGAME && !m_aClients[i].m_Quitting)
				{
					Packet.m_ClientID = i;
					m_NetServer.Send(&Packet);
				}
		}
		else
			m_NetServer.Send(&Packet);
	}
	return 0;
