static const unsigned char *parse_object(cJSON *item, const unsigned char *value, const unsigned char **ep)
{
    cJSON *child = NULL;
    if (*value != '{')
    {
        *ep = value;
        goto fail;
    }
    item->type = cJSON_Object;
    value = skip(value + 1);
    if (*value == '}')
    {
        return value + 1;
    }
    child = cJSON_New_Item();
    item->child = child;
    if (!item->child)
    {
        goto fail;
    }
    value = skip(parse_string(child, skip(value), ep));
    if (!value)
    {
        goto fail;
    }
    child->string = child->valuestring;
    child->valuestring = NULL;
    if (*value != ':')
    {
        *ep = value;
        goto fail;
    }
    value = skip(parse_value(child, skip(value + 1), ep));
    if (!value)
    {
        goto fail;
    }
    while (*value == ',')
    {
        cJSON *new_item = NULL;
        if (!(new_item = cJSON_New_Item()))
        {
            goto fail;
        }
        child->next = new_item;
        new_item->prev = child;
        child = new_item;
        value = skip(parse_string(child, skip(value + 1), ep));
        if (!value)
        {
            goto fail;
        }
        child->string = child->valuestring;
        child->valuestring = NULL;
        if (*value != ':')
        {
            *ep = value;
            goto fail;
        }
        value = skip(parse_value(child, skip(value + 1), ep));
        if (!value)
        {
            goto fail;
        }
    }
    if (*value == '}')
    {
        return value + 1;
    }
    *ep = value;
fail:
    if (item->child != NULL)
    {
        cJSON_Delete(child);
        item->child = NULL;
    }
    return NULL;
}

struct r_bin_dyldcache_obj_t* r_bin_dyldcache_from_bytes_new(const ut8* buf, ut64 size) {
	struct r_bin_dyldcache_obj_t *bin;
	if (!(bin = malloc (sizeof (struct r_bin_dyldcache_obj_t)))) {
		return NULL;
	}
	memset (bin, 0, sizeof (struct r_bin_dyldcache_obj_t));
	if (!buf) {
		return r_bin_dyldcache_free (bin);
	}
	bin->b = r_buf_new();
	if (!r_buf_set_bytes (bin->b, buf, size)) {
		return r_bin_dyldcache_free (bin);
	}
	if (!r_bin_dyldcache_init (bin)) {
		return r_bin_dyldcache_free (bin);
	}
	bin->size = size;
	return bin;
}

