bool CFontFileType1::RemovePfbMarkers()
{
    bool bSuccess = true;
    int nBlockType = 0;
    int nBlockLen  = 0;
    int nChar = 0;
    unsigned char *sBuffer = NULL;
    int nBufLen = 0;
    while ( nBlockType != PFB_DONE )
    {
        while ( 0 == nBlockLen )
        {
            nChar = ReadU8( &bSuccess );
            if ( !bSuccess )
                return false;
            nBlockType = ReadU8( &bSuccess );
            if ( !bSuccess || PFB_MARKER != nChar || ( PFB_ASCII != nBlockType && PFB_BINARY != nBlockType && PFB_DONE != nBlockType ) )
                return false;
            if ( PFB_DONE == nBlockType )
                break;
            nBlockLen = ReadU32LE( &bSuccess );
            if ( !bSuccess )
                return false;
        }
        if ( nBlockLen > 0 )
        {
            if ( !sBuffer )
            {
                sBuffer = (unsigned char*)MemUtilsMalloc( nBlockLen );
                if ( !sBuffer )
                    return false;
            }
            else
                sBuffer = (unsigned char*)MemUtilsRealloc( sBuffer, nBufLen + nBlockLen );
            Read( sBuffer + nBufLen, nBlockLen );
            nBufLen += nBlockLen;
        }
        nBlockLen = 0;
    }
    if ( m_bFreeFileData )
        MemUtilsFree( m_sFile );
    m_bFreeFileData = true;
    m_sFile         = (unsigned char*)sBuffer;
    m_sFileData     = m_sFile;
    m_nLen          = nBufLen;
    m_nPos          = 0;
    return true;
}

static long vbg_misc_device_ioctl(struct file *filp, unsigned int req,
				  unsigned long arg)
{
	struct vbg_session *session = filp->private_data;
	size_t returned_size, size;
	struct vbg_ioctl_hdr hdr;
	bool is_vmmdev_req;
	int ret = 0;
	void *buf;
	if (copy_from_user(&hdr, (void *)arg, sizeof(hdr)))
		return -EFAULT;
	if (hdr.version != VBG_IOCTL_HDR_VERSION)
		return -EINVAL;
	if (hdr.size_in < sizeof(hdr) ||
	    (hdr.size_out && hdr.size_out < sizeof(hdr)))
		return -EINVAL;
	size = max(hdr.size_in, hdr.size_out);
	if (_IOC_SIZE(req) && _IOC_SIZE(req) != size)
		return -EINVAL;
	if (size > SZ_16M)
		return -E2BIG;
	is_vmmdev_req = (req & ~IOCSIZE_MASK) == VBG_IOCTL_VMMDEV_REQUEST(0) ||
			 req == VBG_IOCTL_VMMDEV_REQUEST_BIG;
	if (is_vmmdev_req)
		buf = vbg_req_alloc(size, VBG_IOCTL_HDR_TYPE_DEFAULT);
	else
		buf = kmalloc(size, GFP_KERNEL);
	if (!buf)
		return -ENOMEM;
	if (copy_from_user(buf, (void *)arg, hdr.size_in)) {
		ret = -EFAULT;
		goto out;
	}
	if (hdr.size_in < size)
		memset(buf + hdr.size_in, 0, size -  hdr.size_in);
	ret = vbg_core_ioctl(session, req, buf);
	if (ret)
		goto out;
	returned_size = ((struct vbg_ioctl_hdr *)buf)->size_out;
	if (returned_size > size) {
		vbg_debug("%s: too much output data %zu > %zu\n",
			  __func__, returned_size, size);
		returned_size = size;
	}
	if (copy_to_user((void *)arg, buf, returned_size) != 0)
		ret = -EFAULT;
out:
	if (is_vmmdev_req)
		vbg_req_free(buf, size);
	else
		kfree(buf);
	return ret;
}

static int raw_cmd_copyout(int cmd, void __user *param,
				  struct floppy_raw_cmd *ptr)
{
	int ret;
	while (ptr) {
		ret = copy_to_user(param, ptr, sizeof(*ptr));
		if (ret)
			return -EFAULT;
		param += sizeof(struct floppy_raw_cmd);
		if ((ptr->flags & FD_RAW_READ) && ptr->buffer_length) {
			if (ptr->length >= 0 &&
			    ptr->length <= ptr->buffer_length) {
				long length = ptr->buffer_length - ptr->length;
				ret = fd_copyout(ptr->data, ptr->kernel_data,
						 length);
				if (ret)
					return ret;
			}
		}
		ptr = ptr->next;
	}
	return 0;
}

