htc_request_check_hdrs(struct sess *sp, struct http *hp)
{
	int u;
	int seen_host = 0;
	int seen_cl = 0;
	for (u = HTTP_HDR_FIRST; u < hp->nhd; u++) {
		if (hp->hd[u].b == NULL)
			continue;
		AN(hp->hd[u].b);
		AN(hp->hd[u].e);
		if (http_IsHdr(&hp->hd[u], H_Host)) {
			if (seen_host) {
				WSP(sp, SLT_Error, "Duplicated Host header");
				return (400);
			}
			seen_host = 1;
		}
		if (http_IsHdr(&hp->hd[u], H_Content_Length)) {
			if (seen_cl) {
				WSP(sp, SLT_Error,
				    "Duplicated Content-Length header");
				return (400);
			}
			seen_cl = 1;
		}
	}
	return (0);
}

int ip6_find_1stfragopt(struct sk_buff *skb, u8 **nexthdr)
{
	unsigned int offset = sizeof(struct ipv6hdr);
	unsigned int packet_len = skb_tail_pointer(skb) -
		skb_network_header(skb);
	int found_rhdr = 0;
	*nexthdr = &ipv6_hdr(skb)->nexthdr;
	while (offset <= packet_len) {
		struct ipv6_opt_hdr *exthdr;
		unsigned int len;
		switch (**nexthdr) {
		case NEXTHDR_HOP:
			break;
		case NEXTHDR_ROUTING:
			found_rhdr = 1;
			break;
		case NEXTHDR_DEST:
#if IS_ENABLED(CONFIG_IPV6_MIP6)
			if (ipv6_find_tlv(skb, offset, IPV6_TLV_HAO) >= 0)
				break;
#endif
			if (found_rhdr)
				return offset;
			break;
		default:
			return offset;
		}
		if (offset + sizeof(struct ipv6_opt_hdr) > packet_len)
			return -EINVAL;
		exthdr = (struct ipv6_opt_hdr *)(skb_network_header(skb) +
						 offset);
		len = ipv6_optlen(exthdr);
		if (len + offset >= IPV6_MAXPLEN)
			return -EINVAL;
		offset += len;
		*nexthdr = &exthdr->nexthdr;
	}
	return -EINVAL;
}

header_gets (SF_PRIVATE *psf, char *ptr, int bufsize)
{	int		k ;
	for (k = 0 ; k < bufsize - 1 ; k++)
	{	if (psf->headindex < psf->headend)
		{	ptr [k] = psf->header [psf->headindex] ;
			psf->headindex ++ ;
			}
		else
		{	psf->headend += psf_fread (psf->header + psf->headend, 1, 1, psf) ;
			ptr [k] = psf->header [psf->headindex] ;
			psf->headindex = psf->headend ;
			} ;
		if (ptr [k] == '\n')
			break ;
		} ;
	ptr [k] = 0 ;
	return k ;
}

