blockmix_salsa8(__m128i * Bin, __m128i * Bout, __m128i * X, size_t r)
{
  size_t i;
  blkcpy(X, &Bin[8 * r - 4], 64);
  for (i = 0; i < r; i++) {
    blkxor(X, &Bin[i * 8], 64);
    salsa20_8(X);
    blkcpy(&Bout[i * 4], X, 64);
    blkxor(X, &Bin[i * 8 + 4], 64);
    salsa20_8(X);
    blkcpy(&Bout[(r + i) * 4], X, 64);
  }
}

