  auto thread = std::thread([&]() { svr.listen(HOST, PORT); });
  auto se = detail::scope_exit([&] {
    svr.stop();
    thread.join();
    ASSERT_FALSE(svr.is_running());
  });
  std::this_thread::sleep_for(std::chrono::seconds(1));
  {
    Client cli(HOST, PORT);
    cli.Post("/test1", "A=B",
             "application/x-www-form-urlencoded\r\nevil: hello1");
    cli.Delete("/test2", "A=B", "text/plain\r\nevil: hello2");
    cli.Put("/test3", "text", "text/plain\r\nevil: hello3");
    cli.Patch("/test4", "content", "text/plain\r\nevil: hello4");
  }
}

void Compute(OpKernelContext* context) override {
  INDEX_TYPE first_dimension;
  const Tensor first_partition_tensor =
      context->input(kFirstPartitionInputIndex);
  OP_REQUIRES(context, first_partition_tensor.NumElements() > 0,
              errors::InvalidArgument("Invalid first partition input. Tensor "
                                      "requires at least one element."));
  OP_REQUIRES_OK(context, GetFirstDimensionSize(context, &first_dimension));
  vector<INDEX_TYPE> output_size;
  OP_REQUIRES_OK(context,
                 CalculateOutputSize(first_dimension, context, &output_size));
  vector<INDEX_TYPE> multiplier;
  multiplier.resize(ragged_rank_ + 1);
  multiplier[multiplier.size() - 1] = 1;
  for (int i = multiplier.size() - 2; i >= 0; --i) {
    multiplier[i] = multiplier[i + 1] * output_size[i + 1];
  }
  TensorShape output_shape;
  OP_REQUIRES_OK(context,
                 TensorShapeUtils::MakeShape(output_size, &output_shape));
  Tensor* output_tensor = nullptr;
  OP_REQUIRES_OK(context,
                 context->allocate_output(0, output_shape, &output_tensor));
  const INDEX_TYPE full_size = multiplier[0] * output_size[0];
  if (full_size > 0) {
    vector<INDEX_TYPE> output_index, new_output_index;
    int nvals = context->input(kValueInputIndex).shape().dim_size(0);
    output_index.reserve(nvals);
    new_output_index.reserve(nvals);
    CalculateFirstParentOutputIndex(first_dimension, multiplier[0],
                                    output_size[0], &output_index);
    for (int i = 1; i <= ragged_rank_; ++i) {
      OP_REQUIRES_OK(context, CalculateOutputIndex(
                                  context, i - 1, output_index, multiplier[i],
                                  output_size[i], &new_output_index));
      output_index.swap(new_output_index);
      new_output_index.clear();
    }
    SetOutput(context, ragged_rank_, output_index, output_tensor);
  }
}

void ACLosslessScan::ParseMCU(struct Line **prev,struct Line **top)
{ 
#if ACCUSOFT_CODE
  UBYTE c;
  for(c = 0;c < m_ucCount;c++) {
    struct QMContextSet &contextset = m_Context[m_ucContext[c]];
    struct Line *line = top[c];
    struct Line *pline= prev[c];
    UBYTE ym = m_ucMCUHeight[c];
    ULONG  x = m_ulX[c];
    class PredictorBase *mcupred = m_pPredict[c];
    LONG *lp = line->m_pData + x;
    LONG *pp = (pline)?(pline->m_pData + x):(NULL);
    do {
      class PredictorBase *pred = mcupred;
      UBYTE xm = m_ucMCUWidth[c];
      do {
        LONG v;
        struct QMContextSet::ContextZeroSet &zset = contextset.ClassifySignZero(m_plDa[c][ym-1],m_plDb[c][x],
                                                                                m_ucSmall[c],m_ucLarge[c]);
        if (m_Coder.Get(zset.S0)) {
          LONG sz   = 0;
          bool sign = m_Coder.Get(zset.SS); 
          if (m_Coder.Get((sign)?(zset.SN):(zset.SP))) {
            struct QMContextSet::MagnitudeSet &mset = contextset.ClassifyMagnitude(m_plDb[c][x],m_ucLarge[c]);
            int  i = 0;
            LONG m = 2;
            while(m_Coder.Get(mset.X[i])) {
              m <<= 1;
              i++;
            }
            m >>= 1;
            sz  = m;
            while((m >>= 1)) {
              if (m_Coder.Get(mset.M[i])) {
                sz |= m;
              }
            }
          }
          if (sign) {
            v = -sz - 1;
          } else {
            v =  sz + 1;
          }
        } else {
          v = 0;
        }
        lp[0] = pred->DecodeSample(v,lp,pp);
        m_plDb[c][x]    = v;
        m_plDa[c][ym-1] = v;
      } while(--xm && (lp++,pp++,x++,pred = pred->MoveRight(),true));
    } while(--ym && (pp = line->m_pData + (x = m_ulX[c]),line = (line->m_pNext)?(line->m_pNext):(line),
                     lp = line->m_pData + x,mcupred = mcupred->MoveDown(),true));
  }
#else
  NOREF(prev);
  NOREF(top);
#endif
}

