snmp_ber_encode_integer(unsigned char *out, uint32_t *out_len, uint32_t number)
{
  uint32_t original_out_len;
  original_out_len = *out_len;
  do {
    (*out_len)++;
    *out-- = (uint8_t)(number & 0xFF);
    number >>= 8;
  } while(number);
  out = snmp_ber_encode_length(out, out_len, ((*out_len - original_out_len) & 0xFF));
  out = snmp_ber_encode_type(out, out_len, BER_DATA_TYPE_INTEGER);
  return out;
}

static void *etm_setup_aux(int event_cpu, void **pages,
			   int nr_pages, bool overwrite)
{
	int cpu;
	cpumask_t *mask;
	struct coresight_device *sink;
	struct etm_event_data *event_data = NULL;
	event_data = alloc_event_data(event_cpu);
	if (!event_data)
		return NULL;
	sink = coresight_get_enabled_sink(true);
	if (!sink)
		goto err;
	INIT_WORK(&event_data->work, free_event_data);
	mask = &event_data->mask;
	for_each_cpu(cpu, mask) {
		struct coresight_device *csdev;
		csdev = per_cpu(csdev_src, cpu);
		if (!csdev)
			goto err;
		event_data->path[cpu] = coresight_build_path(csdev, sink);
		if (IS_ERR(event_data->path[cpu]))
			goto err;
	}
	if (!sink_ops(sink)->alloc_buffer)
		goto err;
	cpu = cpumask_first(mask);
	event_data->snk_config =
			sink_ops(sink)->alloc_buffer(sink, cpu, pages,
						     nr_pages, overwrite);
	if (!event_data->snk_config)
		goto err;
out:
	return event_data;
err:
	etm_free_aux(event_data);
	event_data = NULL;
	goto out;
}

static bool __f2fs_init_extent_tree(struct inode *inode, struct f2fs_extent *i_ext)
{
	struct f2fs_sb_info *sbi = F2FS_I_SB(inode);
	struct extent_tree *et;
	struct extent_node *en;
	struct extent_info ei;
	if (!f2fs_may_extent_tree(inode)) {
		if (i_ext && i_ext->len) {
			i_ext->len = 0;
			return true;
		}
		return false;
	}
	et = __grab_extent_tree(inode);
	if (!i_ext || !i_ext->len)
		return false;
	get_extent_info(&ei, i_ext);
	write_lock(&et->lock);
	if (atomic_read(&et->node_cnt))
		goto out;
	en = __init_extent_tree(sbi, et, &ei);
	if (en) {
		spin_lock(&sbi->extent_lock);
		list_add_tail(&en->list, &sbi->extent_list);
		spin_unlock(&sbi->extent_lock);
	}
out:
	write_unlock(&et->lock);
	return false;
}

