		return NULL;
	d = pHba->channel[chan].device[id];
	if(!d || d->tid == 0) {
		return NULL;
	}
	if(d->scsi_lun == lun){
		return d;
	}
	for(d=d->next_lun ; d ; d = d->next_lun){
		if(d->scsi_lun == lun){
			return d;
		}
	}
	return NULL;
}

