		.num_concurrent_stacks = num_cpus,
		.per_cpu_save_state_size = save_state_size,
		.num_concurrent_save_states = num_cpus,
	};
	if (mp_state.ops.adjust_smm_params != NULL)
		mp_state.ops.adjust_smm_params(&smm_params, 1);
	printk(BIOS_DEBUG, "Installing SMM handler to 0x%08lx\n", smbase);
	if (smm_load_module((void *)smbase, smsize, &smm_params))
		return -1;
	adjust_smm_apic_id_map(&smm_params);
	return 0;
}

void xmlrpc_char_encode(char *outbuffer, const char *s1)
{
	long unsigned int i;
	unsigned char c;
	char buf2[15];
	mowgli_string_t *s = mowgli_string_create();
	*buf2 = '\0';
	*outbuffer = '\0';
	if ((!(s1) || (*(s1) == '\0')))
	{
		return;
	}
	for (i = 0; s1[i] != '\0'; i++)
	{
		c = s1[i];
		if (c > 127)
		{
			snprintf(buf2, sizeof buf2, "&#%d;", c);
			s->append(s, buf2, strlen(buf2));
		}
		else if (c == '&')
		{
			s->append(s, "&amp;", 5);
		}
		else if (c == '<')
		{
			s->append(s, "&lt;", 4);
		}
		else if (c == '>')
		{
			s->append(s, "&gt;", 4);
		}
		else if (c == '"')
		{
			s->append(s, "&quot;", 6);
		}
		else
		{
			s->append_char(s, c);
		}
	}
	memcpy(outbuffer, s->str, XMLRPC_BUFSIZE);
}

TypeAttr CastQuantizedTypeAttrFromExpressedType(Builder builder,
                                                TypeAttr source, Type target,
                                                int axis) {
  auto source_type = source.getValue().dyn_cast_or_null<ShapedType>();
  if (!source_type) return {};
  auto src_ele_type = source_type.getElementType();
  auto qtype = src_ele_type.dyn_cast<quant::QuantizedType>();
  if (auto per_axis =
          qtype.dyn_cast_or_null<quant::UniformQuantizedPerAxisType>()) {
    if (axis == -1) return {};
    qtype =
        ResetAxisAndBroadcast(source_type.getShape(), per_axis, target, axis);
  }
  if (!qtype) return {};
  Type final_type = qtype.castFromExpressedType(target);
  if (!final_type) return {};
  return TypeAttr::get(final_type);
}

static size_t write_cb(void *contents, size_t size, size_t nmemb, void *data)
{
    size_t realsize = 0;
    connection_t *conn = NULL;
    char *ptr = NULL;
    conn = data;
    ogs_assert(conn);
    realsize = size * nmemb;
    ptr = ogs_realloc(conn->memory, conn->size + realsize + 1);
    if(!ptr) {
        ogs_fatal("not enough memory (realloc returned NULL)");
        ogs_assert_if_reached();
        return 0;
    }
    conn->memory = ptr;
    memcpy(&(conn->memory[conn->size]), contents, realsize);
    conn->size += realsize;
    conn->memory[conn->size] = 0;
    return realsize;
}

void ComputeAsync(OpKernelContext* c, DoneCallback done) override {
  auto col_params = new CollectiveParams();
  auto done_with_cleanup = [col_params, done = std::move(done)]() {
    done();
    col_params->Unref();
  };
  core::RefCountPtr<CollectiveGroupResource> resource;
  OP_REQUIRES_OK_ASYNC(c, LookupResource(c, HandleFromInput(c, 1), &resource),
                       done);
  Tensor group_assignment = c->input(2);
  OP_REQUIRES_OK_ASYNC(
      c,
      FillCollectiveParams(col_params, group_assignment,
                           ALL_TO_ALL_COLLECTIVE, resource.get()),
      done);
  col_params->instance.shape = c->input(0).shape();
  VLOG(1) << "CollectiveAllToAll group_size " << col_params->group.group_size
          << " group_key " << col_params->group.group_key << " instance_key "
          << col_params->instance.instance_key;
  Tensor* output = nullptr;
  OP_REQUIRES_OK_ASYNC(c,
                       c->forward_input_or_allocate_output(
                           {0}, 0, col_params->instance.shape, &output),
                       done_with_cleanup);
  Run(c, col_params, std::move(done_with_cleanup));
}

