njs_module_path(njs_vm_t *vm, const njs_str_t *dir, njs_module_info_t *info)
{
    char        *p;
    size_t      length;
    njs_bool_t  trail;
    char        src[NJS_MAX_PATH + 1];
    trail = 0;
    length = info->name.length;
    if (dir != NULL) {
        length = dir->length;
        if (length == 0) {
            return NJS_DECLINED;
        }
        trail = (dir->start[dir->length - 1] != '/');
        if (trail) {
            length++;
        }
    }
    if (njs_slow_path(length > NJS_MAX_PATH)) {
        return NJS_ERROR;
    }
    p = &src[0];
    if (dir != NULL) {
        p = (char *) njs_cpymem(p, dir->start, dir->length);
        if (trail) {
            *p++ = '/';
        }
    }
    p = (char *) njs_cpymem(p, info->name.start, info->name.length);
    *p = '\0';
    p = realpath(&src[0], &info->path[0]);
    if (p == NULL) {
        return NJS_DECLINED;
    }
    info->fd = open(&info->path[0], O_RDONLY);
    if (info->fd < 0) {
        return NJS_DECLINED;
    }
    info->file.start = (u_char *) &info->path[0];
    info->file.length = njs_strlen(info->file.start);
    return NJS_OK;
}

print_attr_string(netdissect_options *ndo,
                  register const u_char *data, u_int length, u_short attr_code)
{
   register u_int i;
   ND_TCHECK2(data[0],length);
   switch(attr_code)
   {
      case TUNNEL_PASS:
           if (length < 3)
           {
              ND_PRINT((ndo, "%s", tstr));
              return;
           }
           if (*data && (*data <=0x1F) )
              ND_PRINT((ndo, "Tag[%u] ", *data));
           else
              ND_PRINT((ndo, "Tag[Unused] "));
           data++;
           length--;
           ND_PRINT((ndo, "Salt %u ", EXTRACT_16BITS(data)));
           data+=2;
           length-=2;
        break;
      case TUNNEL_CLIENT_END:
      case TUNNEL_SERVER_END:
      case TUNNEL_PRIV_GROUP:
      case TUNNEL_ASSIGN_ID:
      case TUNNEL_CLIENT_AUTH:
      case TUNNEL_SERVER_AUTH:
           if (*data <= 0x1F)
           {
              if (length < 1)
              {
                 ND_PRINT((ndo, "%s", tstr));
                 return;
              }
              if (*data)
                ND_PRINT((ndo, "Tag[%u] ", *data));
              else
                ND_PRINT((ndo, "Tag[Unused] "));
              data++;
              length--;
           }
        break;
      case EGRESS_VLAN_NAME:
           ND_PRINT((ndo, "%s (0x%02x) ",
                  tok2str(rfc4675_tagged,"Unknown tag",*data),
                  *data));
           data++;
           length--;
        break;
   }
   for (i=0; *data && i < length ; i++, data++)
       ND_PRINT((ndo, "%c", (*data < 32 || *data > 126) ? '.' : *data));
   return;
   trunc:
      ND_PRINT((ndo, "%s", tstr));
}

static int edit_ext(char* editor, char* name, char* date, char* data)
{
	int fd;
	int st;
	int sz;
	char* b;
	char* l;
	char buff[512];
	pid_t pid;
	strcpy(buff,"/tmp/nodau.XXXXXX");
	fd = mkstemp(buff);
	if (fd < 0)
		return 1;
	pid = fork();
	if (pid < 0) {
		return 1;
	}else if (pid) {
		close(fd);
		waitpid(pid,&st,0);
		if (!st) {
			if ((fd = open(buff,O_RDONLY)) < 0)
				return 1;
			sz = lseek(fd,0,SEEK_END);
			lseek(fd,0,SEEK_SET);
			if (sz) {
				b = alloca(sz+1);
				if (sz != read(fd,b,sz))
					return 1;
				close(fd);
				remove(buff);
				b[sz] = 0;
				l = strstr(b,"-----");
				if (l) {
					l += 6;
					if (db_update(name,l))
						return 1;
					printf("%s saved\n",name);
				}
			}
		}
		return st;
	}
	sz = strlen(name)+strlen(date)+strlen(data)+50;
	b = alloca(sz);
	sz = sprintf(
		b,
		"%s (%s)\nText above this line is ignored\n-----\n%s",
		name,
		date,
		data
	);
	if (write(fd,b,sz) != sz) {
		exit(1);
	}
	fsync(fd);
	close(fd);
	st = execl(editor,editor,buff,(char*)NULL);
	exit(st);
	return 1;
}

static u32 __ipv6_select_ident(struct net *net, u32 hashrnd,
			       const struct in6_addr *dst,
			       const struct in6_addr *src)
{
	u32 hash, id;
	hash = __ipv6_addr_jhash(dst, hashrnd);
	hash = __ipv6_addr_jhash(src, hash);
	hash ^= net_hash_mix(net);
	id = ip_idents_reserve(hash, 1);
	if (unlikely(!id))
		id = 1 << 31;
	return id;
}

