avp_enum(struct l2tp_avp *avp, const u_char *pkt, int pktlen, int filldata)
{
	uint16_t flags;
	L2TP_SUBR_ASSERT(pktlen >= 6);
	if (pktlen < 6)
		return -1;
	GETSHORT(flags, pkt);
	avp->is_mandatory = ((flags & 0x8000) != 0)? 1 : 0;
	avp->is_hidden = ((flags & 0x4000) != 0)? 1 : 0;
	avp->length = flags & 0x03ff;
	GETSHORT(avp->vendor_id, pkt);
	avp->attr_type = *pkt << 8;
	avp->attr_type |= *(pkt + 1);
	pkt += 2;
	if (avp->length > pktlen)
		return -1;
	if (filldata != 0)
		memcpy(avp->attr_value, pkt, avp->length - 6);
	return avp->length;
}

int verify_iovec(struct msghdr *m, struct iovec *iov, struct sockaddr_storage *address, int mode)
{
	int size, ct, err;
	if (m->msg_namelen) {
		if (mode == VERIFY_READ) {
			void __user *namep;
			namep = (void __user __force *) m->msg_name;
			err = move_addr_to_kernel(namep, m->msg_namelen,
						  address);
			if (err < 0)
				return err;
		}
		m->msg_name = address;
	} else {
		m->msg_name = NULL;
	}
	size = m->msg_iovlen * sizeof(struct iovec);
	if (copy_from_user(iov, (void __user __force *) m->msg_iov, size))
		return -EFAULT;
	m->msg_iov = iov;
	err = 0;
	for (ct = 0; ct < m->msg_iovlen; ct++) {
		size_t len = iov[ct].iov_len;
		if (len > INT_MAX - err) {
			len = INT_MAX - err;
			iov[ct].iov_len = len;
		}
		err += len;
	}
	return err;
}

static int crypto_rsa_common(const BYTE* input, int length, UINT32 key_length, const BYTE* modulus,
                             const BYTE* exponent, int exponent_size, BYTE* output)
{
	BN_CTX* ctx;
	int output_length = -1;
	BYTE* input_reverse;
	BYTE* modulus_reverse;
	BYTE* exponent_reverse;
	BIGNUM *mod, *exp, *x, *y;
	input_reverse = (BYTE*)malloc(2 * key_length + exponent_size);
	if (!input_reverse)
		return -1;
	modulus_reverse = input_reverse + key_length;
	exponent_reverse = modulus_reverse + key_length;
	memcpy(modulus_reverse, modulus, key_length);
	crypto_reverse(modulus_reverse, key_length);
	memcpy(exponent_reverse, exponent, exponent_size);
	crypto_reverse(exponent_reverse, exponent_size);
	memcpy(input_reverse, input, length);
	crypto_reverse(input_reverse, length);
	if (!(ctx = BN_CTX_new()))
		goto fail_bn_ctx;
	if (!(mod = BN_new()))
		goto fail_bn_mod;
	if (!(exp = BN_new()))
		goto fail_bn_exp;
	if (!(x = BN_new()))
		goto fail_bn_x;
	if (!(y = BN_new()))
		goto fail_bn_y;
	BN_bin2bn(modulus_reverse, key_length, mod);
	BN_bin2bn(exponent_reverse, exponent_size, exp);
	BN_bin2bn(input_reverse, length, x);
	BN_mod_exp(y, x, exp, mod, ctx);
	output_length = BN_bn2bin(y, output);
	crypto_reverse(output, output_length);
	if (output_length < (int)key_length)
		memset(output + output_length, 0, key_length - output_length);
	BN_free(y);
fail_bn_y:
	BN_clear_free(x);
fail_bn_x:
	BN_free(exp);
fail_bn_exp:
	BN_free(mod);
fail_bn_mod:
	BN_CTX_free(ctx);
fail_bn_ctx:
	free(input_reverse);
	return output_length;
}

