_SSL_match_hostname (const char *cert_hostname, const char *hostname)
{
	const char *cert_domain, *domain, *next_dot;
	if (g_ascii_strcasecmp (cert_hostname, hostname) == 0)
		return 0;
	if (cert_hostname[0] == '*')
	{
		cert_domain = &cert_hostname[1];
		if (cert_domain[0] == '\0')
			return -1;
		if (cert_domain[0] != '.')
			return -1;
		if (cert_domain[1] == '.')
			return -1;
		next_dot = strchr (&cert_domain[1], '.');
		if (next_dot == NULL)
			return -1;
		if (next_dot[1] == '.')
			return -1;
		domain = strchr (hostname, '.');
		if (domain == NULL || strlen(domain) == 1)
			return -1;
		if (g_ascii_strcasecmp (cert_domain, domain) == 0)
			return 0;
	}
	return -1;
}

static inline int preempt_count_equals(int preempt_offset)
{
	int nested = preempt_count() + rcu_preempt_depth();
	return (nested == preempt_offset);
}

njs_vmcode_array(njs_vm_t *vm, u_char *pc)
{
    uint32_t            length;
    njs_array_t         *array;
    njs_value_t         *value;
    njs_vmcode_array_t  *code;
    code = (njs_vmcode_array_t *) pc;
    array = njs_array_alloc(vm, 0, code->length, NJS_ARRAY_SPARE);
    if (njs_fast_path(array != NULL)) {
        if (code->ctor) {
            value = array->start;
            length = array->length;
            do {
                njs_set_invalid(value);
                value++;
                length--;
            } while (length != 0);
        } else {
            array->length = 0;
        }
        njs_set_array(&vm->retval, array);
        return sizeof(njs_vmcode_array_t);
    }
    return NJS_ERROR;
}

