void AddBatchOffsets(Tensor* indices, const Tensor& params) {
  int64_t batch_size = 1;  
  for (int idx = 0; idx < batch_dims_; ++idx) {
    batch_size *= params.dim_size(idx);
  }
  auto indices_flat = indices->flat<Index>();
  int64_t const index_inner_size = indices->NumElements() / batch_size;
  int64_t const batch_offset = params.dim_size(batch_dims_);
  for (int64_t batch_idx = 0, dest_idx = 0; batch_idx < batch_size;
       ++batch_idx) {
    for (int64_t idx = 0; idx < index_inner_size; ++idx) {
      indices_flat(dest_idx++) += batch_offset * batch_idx;
    }
  }
}

static void nalm_dump(FILE * trace, char *data, u32 data_size)
{
	GF_BitStream *bs;
	Bool rle, large_size;
	u32 entry_count;
	if (!data) {
		fprintf(trace, "<NALUMap rle=\"\" large_size=\"\">\n");
		fprintf(trace, "<NALUMapEntry NALU_startNumber=\"\" groupID=\"\"/>\n");
		fprintf(trace, "</NALUMap>\n");
		return;
	}
	bs = gf_bs_new(data, data_size, GF_BITSTREAM_READ);
	gf_bs_read_int(bs, 6);
	large_size = gf_bs_read_int(bs, 1);
	rle = gf_bs_read_int(bs, 1);
	entry_count = gf_bs_read_int(bs, large_size ? 16 : 8);
	fprintf(trace, "<NALUMap rle=\"%d\" large_size=\"%d\">\n", rle, large_size);
	while (entry_count) {
		u32 ID;
		fprintf(trace, "<NALUMapEntry ");
		if (rle) {
			u32 start_num = gf_bs_read_int(bs, large_size ? 16 : 8);
			fprintf(trace, "NALU_startNumber=\"%d\" ", start_num);
		}
		ID = gf_bs_read_u16(bs);
		fprintf(trace, "groupID=\"%d\"/>\n", ID);
		entry_count--;
	}
	gf_bs_del(bs);
	fprintf(trace, "</NALUMap>\n");
	return;
}

static void write_cb(struct bt_att_chan *chan, uint8_t opcode, const void *pdu,
					uint16_t length, void *user_data)
{
	struct bt_gatt_server *server = user_data;
	struct gatt_db_attribute *attr;
	uint16_t handle = 0;
	struct async_write_op *op = NULL;
	uint8_t ecode;
	if (length < 2) {
		ecode = BT_ATT_ERROR_INVALID_PDU;
		goto error;
	}
	ecode = authorize_req(server, opcode, handle);
	if (ecode)
		goto error;
	handle = get_le16(pdu);
	attr = gatt_db_get_attribute(server->db, handle);
	if (!attr) {
		ecode = BT_ATT_ERROR_INVALID_HANDLE;
		goto error;
	}
	util_debug(server->debug_callback, server->debug_data,
				"Write %s - handle: 0x%04x",
				(opcode == BT_ATT_OP_WRITE_REQ) ? "Req" : "Cmd",
				handle);
	ecode = check_length(length, 0);
	if (ecode)
		goto error;
	ecode = check_permissions(server, attr, BT_ATT_PERM_WRITE_MASK);
	if (ecode)
		goto error;
	op = new0(struct async_write_op, 1);
	op->chan = chan;
	op->server = bt_gatt_server_ref(server);
	op->opcode = opcode;
	if (gatt_db_attribute_write(attr, 0, pdu + 2, length - 2, opcode,
							server->att,
							write_complete_cb, op))
		return;
	async_write_op_destroy(op);
	ecode = BT_ATT_ERROR_UNLIKELY;
error:
	if (opcode == BT_ATT_OP_WRITE_CMD)
		return;
	bt_att_chan_send_error_rsp(chan, opcode, handle, ecode);
}

