static int llcp_sock_bind(struct socket *sock, struct sockaddr *addr, int alen)
{
	struct sock *sk = sock->sk;
	struct nfc_llcp_sock *llcp_sock = nfc_llcp_sock(sk);
	struct nfc_llcp_local *local;
	struct nfc_dev *dev;
	struct sockaddr_nfc_llcp llcp_addr;
	int len, ret = 0;
	if (!addr || addr->sa_family != AF_NFC)
		return -EINVAL;
	pr_debug("sk %p addr %p family %d\n", sk, addr, addr->sa_family);
	memset(&llcp_addr, 0, sizeof(llcp_addr));
	len = min_t(unsigned int, sizeof(llcp_addr), alen);
	memcpy(&llcp_addr, addr, len);
	if (llcp_addr.dsap != 0)
		return -EINVAL;
	lock_sock(sk);
	if (sk->sk_state != LLCP_CLOSED) {
		ret = -EBADFD;
		goto error;
	}
	dev = nfc_get_device(llcp_addr.dev_idx);
	if (dev == NULL) {
		ret = -ENODEV;
		goto error;
	}
	local = nfc_llcp_find_local(dev);
	if (local == NULL) {
		ret = -ENODEV;
		goto put_dev;
	}
	llcp_sock->dev = dev;
	llcp_sock->local = nfc_llcp_local_get(local);
	llcp_sock->nfc_protocol = llcp_addr.nfc_protocol;
	llcp_sock->service_name_len = min_t(unsigned int,
					    llcp_addr.service_name_len,
					    NFC_LLCP_MAX_SERVICE_NAME);
	llcp_sock->service_name = kmemdup(llcp_addr.service_name,
					  llcp_sock->service_name_len,
					  GFP_KERNEL);
	llcp_sock->ssap = nfc_llcp_get_sdp_ssap(local, llcp_sock);
	if (llcp_sock->ssap == LLCP_SAP_MAX) {
		ret = -EADDRINUSE;
		goto put_dev;
	}
	llcp_sock->reserved_ssap = llcp_sock->ssap;
	nfc_llcp_sock_link(&local->sockets, sk);
	pr_debug("Socket bound to SAP %d\n", llcp_sock->ssap);
	sk->sk_state = LLCP_BOUND;
put_dev:
	nfc_put_device(dev);
error:
	release_sock(sk);
	return ret;
}

static int sgi_clock_set(clockid_t clockid, struct timespec *tp)
{
	u64 nsec;
	u64 rem;
	nsec = rtc_time() * sgi_clock_period;
	sgi_clock_offset.tv_sec = tp->tv_sec - div_long_long_rem(nsec, NSEC_PER_SEC, &rem);
	if (rem <= tp->tv_nsec)
		sgi_clock_offset.tv_nsec = tp->tv_sec - rem;
	else {
		sgi_clock_offset.tv_nsec = tp->tv_sec + NSEC_PER_SEC - rem;
		sgi_clock_offset.tv_sec--;
	}
	return 0;
}

int jas_stream_read(jas_stream_t *stream, void *buf, int cnt)
{
	int n;
	int c;
	char *bufptr;
	if (cnt < 0) {
		jas_deprecated("negative count for jas_stream_read");
	}
	bufptr = buf;
	n = 0;
	while (n < cnt) {
		if ((c = jas_stream_getc(stream)) == EOF) {
			return n;
		}
		*bufptr++ = c;
		++n;
	}
	return n;
}

static void construct_get_dest_keyring(struct key **_dest_keyring)
{
	struct request_key_auth *rka;
	const struct cred *cred = current_cred();
	struct key *dest_keyring = *_dest_keyring, *authkey;
	kenter("%p", dest_keyring);
	if (dest_keyring) {
		key_get(dest_keyring);
	} else {
		switch (cred->jit_keyring) {
		case KEY_REQKEY_DEFL_DEFAULT:
		case KEY_REQKEY_DEFL_REQUESTOR_KEYRING:
			if (cred->request_key_auth) {
				authkey = cred->request_key_auth;
				down_read(&authkey->sem);
				rka = authkey->payload.data[0];
				if (!test_bit(KEY_FLAG_REVOKED,
					      &authkey->flags))
					dest_keyring =
						key_get(rka->dest_keyring);
				up_read(&authkey->sem);
				if (dest_keyring)
					break;
			}
		case KEY_REQKEY_DEFL_THREAD_KEYRING:
			dest_keyring = key_get(cred->thread_keyring);
			if (dest_keyring)
				break;
		case KEY_REQKEY_DEFL_PROCESS_KEYRING:
			dest_keyring = key_get(cred->process_keyring);
			if (dest_keyring)
				break;
		case KEY_REQKEY_DEFL_SESSION_KEYRING:
			rcu_read_lock();
			dest_keyring = key_get(
				rcu_dereference(cred->session_keyring));
			rcu_read_unlock();
			if (dest_keyring)
				break;
		case KEY_REQKEY_DEFL_USER_SESSION_KEYRING:
			dest_keyring =
				key_get(cred->user->session_keyring);
			break;
		case KEY_REQKEY_DEFL_USER_KEYRING:
			dest_keyring = key_get(cred->user->uid_keyring);
			break;
		case KEY_REQKEY_DEFL_GROUP_KEYRING:
		default:
			BUG();
		}
	}
	*_dest_keyring = dest_keyring;
	kleave(" [dk %d]", key_serial(dest_keyring));
	return;
}

Status ExtractVariantFromInput(OpKernelContext* ctx, int index,
                               const T** value) {
  const Tensor& input_t = ctx->input(index);
  if (!TensorShapeUtils::IsScalar(input_t.shape())) {
    return errors::InvalidArgument(
        "Invalid input matrix: Shape must be rank 0 but is rank ",
        input_t.dims());
  }
  const Variant& input_variant = input_t.scalar<Variant>()();
  *value = input_variant.get<T>();
  if (*value == nullptr) {
    return errors::InvalidArgument("Could not retrieve Variant input ", index);
  }
  if (!(*value)->valid()) {
    return errors::InvalidArgument("Variant input ", index, " is not valid.");
  }
  return OkStatus();
}

void ComputeAsync(OpKernelContext* c, DoneCallback done) override {
  auto col_params = new CollectiveParams();
  auto done_with_cleanup = [col_params, done = std::move(done)]() {
    done();
    col_params->Unref();
  };
  core::RefCountPtr<CollectiveGroupResource> resource;
  OP_REQUIRES_OK_ASYNC(c, LookupResource(c, HandleFromInput(c, 1), &resource),
                       done);
  Tensor group_assignment = c->input(2);
  OP_REQUIRES_OK_ASYNC(
      c,
      FillCollectiveParams(col_params, group_assignment, REDUCTION_COLLECTIVE,
                           resource.get()),
      done);
  col_params->instance.shape = c->input(0).shape();
  col_params->merge_op = merge_op_.get();
  col_params->final_op = final_op_.get();
  VLOG(1) << "CollectiveReduceV3 group_size " << col_params->group.group_size
          << " group_key " << col_params->group.group_key << " instance_key "
          << col_params->instance.instance_key;
  Tensor* output = nullptr;
  OP_REQUIRES_OK_ASYNC(c,
                       c->forward_input_or_allocate_output(
                           {0}, 0, col_params->instance.shape, &output),
                       done_with_cleanup);
  Run(c, col_params, std::move(done_with_cleanup));
}

