service_info *FindServiceControlURLPath(
	service_table *table, const char *controlURLPath)
{
	service_info *finger = NULL;
	uri_type parsed_url;
	uri_type parsed_url_in;
	if (table && parse_uri(controlURLPath,
			     strlen(controlURLPath),
			     &parsed_url_in) == HTTP_SUCCESS) {
		finger = table->serviceList;
		while (finger) {
			if (finger->controlURL) {
				if (parse_uri(finger->controlURL,
					    strlen(finger->controlURL),
					    &parsed_url) == HTTP_SUCCESS) {
					if (!token_cmp(&parsed_url.pathquery,
						    &parsed_url_in.pathquery)) {
						return finger;
					}
				}
			}
			finger = finger->next;
		}
	}
	return NULL;
}

static int32_t check_load_area(uintptr_t dst, uintptr_t len)
{
	uint32_t legacy = dst + len <= UINT32_MAX - 1 ? 1 : 0;
	uintptr_t dram_start, dram_end;
	uintptr_t prot_start, prot_end;
	int32_t result = IO_SUCCESS;
	dram_start = legacy ? DRAM1_NS_BASE : DRAM_40BIT_BASE;
	dram_end = legacy ? DRAM1_NS_BASE + DRAM1_NS_SIZE :
	    DRAM_40BIT_BASE + DRAM_40BIT_SIZE;
	prot_start = legacy ? DRAM_PROTECTED_BASE : DRAM_40BIT_PROTECTED_BASE;
	prot_end = prot_start + DRAM_PROTECTED_SIZE;
	if (dst < dram_start || dst > dram_end - len || dram_end < len) {
		ERROR("BL2: dst address is on the protected area.\n");
		result = IO_FAIL;
		goto done;
	}
	if (dst >= prot_start && dst < prot_end) {
		ERROR("BL2: dst address is on the protected area.\n");
		result = IO_FAIL;
		goto done;
	}
	if ((dst < prot_start && dst > prot_start - len) || prot_start < len) {
		ERROR("BL2: loaded data is on the protected area.\n");
		result = IO_FAIL;
		goto done;
	}
	if (addr_loaded_cnt >= CHECK_IMAGE_AREA_CNT) {
		ERROR("BL2: max loadable non secure images reached\n");
		result = IO_FAIL;
		goto done;
	}
	addr_loaded[addr_loaded_cnt].dest = dst;
	addr_loaded[addr_loaded_cnt].length = len;
	for(int n=0; n<addr_loaded_cnt; n++) {
		if (((dst >= addr_loaded[n].dest) &&
		     (dst <=  addr_loaded[n].dest + addr_loaded[n].length)) ||
		    ((dst + len >= addr_loaded[n].dest) &&
		     (dst + len <= addr_loaded[n].dest + addr_loaded[n].length)) ||
		    ((dst <= addr_loaded[n].dest) &&
		     (dst + len >= addr_loaded[n].dest + addr_loaded[n].length))) {
			ERROR("BL2: next image overlap a previous image area.\n");
			result = IO_FAIL;
			goto done;
		}
	}
	addr_loaded_cnt++;
done:
	if (result == IO_FAIL) {
		ERROR("BL2: Out of range : dst=0x%lx len=0x%lx\n", dst, len);
	}
	return result;
}

void *MACH0_(mach0_free)(struct MACH0_(obj_t) *mo) {
	if (!mo) {
		return NULL;
	}
	size_t i;
	if (mo->symbols) {
		for (i = 0; !mo->symbols[i].last; i++) {
			free (mo->symbols[i].name);
		}
		free (mo->symbols);
	}
	free (mo->segs);
	free (mo->sects);
	free (mo->symtab);
	free (mo->symstr);
	free (mo->indirectsyms);
	free (mo->imports_by_ord);
	ht_pp_free (mo->imports_by_name);
	free (mo->dyld_info);
	free (mo->toc);
	free (mo->modtab);
	free (mo->libs);
	free (mo->func_start);
	free (mo->signature);
	free (mo->intrp);
	free (mo->compiler);
	if (mo->chained_starts) {
		for (i = 0; i < mo->nsegs; i++) {
			if (mo->chained_starts[i]) {
				free (mo->chained_starts[i]->page_start);
				free (mo->chained_starts[i]);
			}
		}
		free (mo->chained_starts);
	}
	r_buf_free (mo->b);
	free (mo);
	return NULL;
