void Compute(OpKernelContext* context) override {
  Tensor encoded_t = context->input(0);
  OP_REQUIRES(
      context, encoded_t.flat<Variant>().size() > 0,
      errors::InvalidArgument("Input `encoded` must not be an empty variant "
                              "tensor, but got ",
                              encoded_t.DebugString()));
  auto* encoded = encoded_t.flat<Variant>()(0).get<CompositeTensorVariant>();
  OP_REQUIRES(context, encoded != nullptr,
              errors::InvalidArgument("The input `encoded` is not a valid "
                                      "CompositeTensorVariant tensor, got ",
                                      encoded_t.DebugString()));
  auto expected_class = metadata_.type_spec_proto().type_spec_class();
  auto actual_class = encoded->metadata().type_spec_proto().type_spec_class();
  OP_REQUIRES(
      context, expected_class == actual_class,
      errors::InvalidArgument(
          "Expected a ", TypeSpecProto::TypeSpecClass_Name(expected_class),
          " (based on `type_spec`), but `encoded` contains a ",
          TypeSpecProto::TypeSpecClass_Name(actual_class)));
  OpOutputList components;
  OP_REQUIRES_OK(context, context->output_list("components", &components));
  int num_components = encoded->flat_components().size();
  OP_REQUIRES(context, component_dtypes_.size() == num_components,
              errors::InvalidArgument("Encoded value has ", num_components,
                                      " tensor components; expected ",
                                      component_dtypes_.size(),
                                      " components based on type_spec"));
  for (int i = 0; i < component_dtypes_.size(); i++) {
    const Tensor& component = encoded->flat_components()[i];
    OP_REQUIRES(context, component_dtypes_[i] == component.dtype(),
                errors::InvalidArgument("Tensor component ", i, " had dtype ",
                                        DataType_Name(component.dtype()),
                                        "; expected dtype ",
                                        DataType_Name(component_dtypes_[i])));
    components.set(i, component);
  }
}

static cache_accel_t *read_cache_accel(RBuffer *cache_buf, cache_hdr_t *hdr, cache_map_t *maps) {
	if (!cache_buf || !hdr || !hdr->accelerateInfoSize || !hdr->accelerateInfoAddr) {
		return NULL;
	}
	ut64 offset = va2pa (hdr->accelerateInfoAddr, hdr->mappingCount, maps, cache_buf, 0, NULL, NULL);
	if (!offset) {
		return NULL;
	}
	ut64 size = sizeof (cache_accel_t);
	cache_accel_t *accel = R_NEW0 (cache_accel_t);
	if (!accel) {
		return NULL;
	}
	if (r_buf_fread_at (cache_buf, offset, (ut8*) accel, "16il", 1) != size) {
		R_FREE (accel);
		return NULL;
	}
	accel->imagesExtrasOffset += offset;
	accel->bottomUpListOffset += offset;
	accel->dylibTrieOffset += offset;
	accel->initializersOffset += offset;
	accel->dofSectionsOffset += offset;
	accel->reExportListOffset += offset;
	accel->depListOffset += offset;
	accel->rangeTableOffset += offset;
	return accel;
}

Jsi_Value *jsi_ValueObjKeyAssign(Jsi_Interp *interp, Jsi_Value *target, Jsi_Value *keyval, Jsi_Value *value, int flag)
{
    int arrayindex = -1;
    if (keyval->vt == JSI_VT_NUMBER && Jsi_NumberIsInteger(keyval->d.num) && keyval->d.num >= 0) {
        arrayindex = (int)keyval->d.num;
    }
    if (arrayindex >= 0 && arrayindex < MAX_ARRAY_LIST &&
        target->vt == JSI_VT_OBJECT && target->d.obj->arr) {
        return jsi_ObjArraySetDup(interp, target->d.obj, value, arrayindex);
    }
    const char *kstr = Jsi_ValueToString(interp, keyval, NULL);
#if (defined(JSI_HAS___PROTO__) && JSI_HAS___PROTO__==2)
    if (Jsi_Strcmp(kstr, "__proto__")==0) {
        Jsi_Obj *obj = target->d.obj;
        obj->__proto__ = Jsi_ValueDup(interp, value);
        return obj->__proto__;
    }
#endif
    Jsi_Value *v = Jsi_ValueNew1(interp);
    if (value)
        Jsi_ValueCopy(interp, v, value);
    jsi_ValueObjSet(interp, target, kstr, v, flag, (Jsi_ValueIsStringKey(interp, keyval)? JSI_OM_ISSTRKEY:0));
    Jsi_DecrRefCount(interp, v);
    return v;
}

