void FrameLoader::checkCompleted()
{
    RefPtr<Frame> protect(m_frame);
    m_shouldCallCheckCompleted = false;
    if (m_frame->view())
        m_frame->view()->handleLoadCompleted();
    if (m_isComplete)
        return;
    if (m_frame->document()->parsing())
        return;
    if (m_frame->document()->fetcher()->requestCount())
        return;
    if (m_frame->document()->isDelayingLoadEvent())
        return;
    if (!allChildrenAreComplete())
        return;
    m_isComplete = true;
    m_requestedHistoryItem = 0;
    m_frame->document()->setReadyState(Document::Complete);
    if (m_frame->document()->loadEventStillNeeded())
        m_frame->document()->implicitClose();
    m_frame->navigationScheduler()->startTimer();
    completed();
    if (m_frame->page())
        checkLoadComplete();
    if (m_frame->view())
        m_frame->view()->handleLoadCompleted();
}

static void  Ins_MDRP( INS_ARG )
{
  Int         point;
  TT_F26Dot6  distance,
              org_dist;
  point = (Int)args[0];
  if ( BOUNDS( args[0], CUR.zp1.n_points ) )
  {
    return;
  }
  org_dist = CUR_Func_dualproj( CUR.zp1.org_x[point] -
                                  CUR.zp0.org_x[CUR.GS.rp0],
                                CUR.zp1.org_y[point] -
                                  CUR.zp0.org_y[CUR.GS.rp0] );
  if ( ABS(org_dist) < CUR.GS.single_width_cutin )
  {
    if ( org_dist >= 0 )
      org_dist = CUR.GS.single_width_value;
    else
      org_dist = -CUR.GS.single_width_value;
  }
  if ( (CUR.opcode & 4) != 0 )
    distance = CUR_Func_round( org_dist,
                               CUR.metrics.compensations[CUR.opcode & 3] );
  else
    distance = Round_None( EXEC_ARGS
                           org_dist,
                           CUR.metrics.compensations[CUR.opcode & 3]  );
  if ( (CUR.opcode & 8) != 0 )
  {
    if ( org_dist >= 0 )
    {
      if ( distance < CUR.GS.minimum_distance )
        distance = CUR.GS.minimum_distance;
    }
    else
    {
      if ( distance > -CUR.GS.minimum_distance )
        distance = -CUR.GS.minimum_distance;
    }
  }
  org_dist = CUR_Func_project( CUR.zp1.cur_x[point] -
                                 CUR.zp0.cur_x[CUR.GS.rp0],
                               CUR.zp1.cur_y[point] -
                                 CUR.zp0.cur_y[CUR.GS.rp0] );
  CUR_Func_move( &CUR.zp1, point, distance - org_dist );
  CUR.GS.rp1 = CUR.GS.rp0;
  CUR.GS.rp2 = point;
  if ( (CUR.opcode & 16) != 0 )
    CUR.GS.rp0 = point;
}

mt76_add_fragment(struct mt76_dev *dev, struct mt76_queue *q, void *data,
		  int len, bool more)
{
	struct page *page = virt_to_head_page(data);
	int offset = data - page_address(page);
	struct sk_buff *skb = q->rx_head;
	offset += q->buf_offset;
	skb_add_rx_frag(skb, skb_shinfo(skb)->nr_frags, page, offset, len,
			q->buf_size);
