CImg<T>& RGBtoYUV() {
  if (_spectrum!=3)
    throw CImgInstanceException(_cimg_instance
                                "RGBtoYUV(): Instance is not a RGB image.",
                                cimg_instance);
  T *p1 = data(0,0,0,0), *p2 = data(0,0,0,1), *p3 = data(0,0,0,2);
  const ulongT whd = (ulongT)_width*_height*_depth;
  cimg_pragma_openmp(parallel for cimg_openmp_if(whd>=16384))
  for (ulongT N = 0; N<whd; ++N) {
    const Tfloat
      R = (Tfloat)p1[N]/255,
      G = (Tfloat)p2[N]/255,
      B = (Tfloat)p3[N]/255,
      Y = 0.299f*R + 0.587f*G + 0.114f*B;
    p1[N] = (T)Y;
    p2[N] = (T)(0.492f*(B - Y));
    p3[N] = (T)(0.877*(R - Y));
  }
  return *this;

decode_rt_routing_info(netdissect_options *ndo,
                       const u_char *pptr, char *buf, u_int buflen)
{
	uint8_t route_target[8];
	u_int plen;
	ND_TCHECK(pptr[0]);
	plen = pptr[0];   
	if (0 == plen) {
		snprintf(buf, buflen, "default route target");
		return 1;
	}
	if (32 > plen)
		return -1;
        plen-=32; 
	if (64 < plen)
		return -1;
	memset(&route_target, 0, sizeof(route_target));
	ND_TCHECK2(pptr[1], (plen + 7) / 8);
	memcpy(&route_target, &pptr[1], (plen + 7) / 8);
	if (plen % 8) {
		((u_char *)&route_target)[(plen + 7) / 8 - 1] &=
			((0xff00 >> (plen % 8)) & 0xff);
	}
	snprintf(buf, buflen, "origin AS: %s, route target %s",
	    as_printf(ndo, astostr, sizeof(astostr), EXTRACT_32BITS(pptr+1)),
	    bgp_vpn_rd_print(ndo, (u_char *)&route_target));
	return 5 + (plen + 7) / 8;
trunc:
	return -2;
}

static UINT printer_process_irp_write(PRINTER_DEVICE* printer_dev, IRP* irp)
{
	UINT32 Length;
	UINT64 Offset;
	rdpPrintJob* printjob = NULL;
	UINT error = CHANNEL_RC_OK;
	Stream_Read_UINT32(irp->input, Length);
	Stream_Read_UINT64(irp->input, Offset);
	Stream_Seek(irp->input, 20); 
	if (printer_dev->printer)
		printjob = printer_dev->printer->FindPrintJob(printer_dev->printer, irp->FileId);
	if (!printjob)
	{
		irp->IoStatus = STATUS_UNSUCCESSFUL;
		Length = 0;
	}
	else
	{
		error = printjob->Write(printjob, Stream_Pointer(irp->input), Length);
	}
	if (error)
	{
		WLog_ERR(TAG, "printjob->Write failed with error %" PRIu32 "!", error);
		return error;
	}
	Stream_Write_UINT32(irp->output, Length);
	Stream_Write_UINT8(irp->output, 0); 
	return irp->Complete(irp);
}

