ssize_t uv__idna_toascii(const char* s, const char* se, char* d, char* de) {
  const char* si;
  const char* st;
  unsigned c;
  char* ds;
  int rc;
  ds = d;
  si = s;
  while (si < se) {
    st = si;
    c = uv__utf8_decode1(&si, se);
    if (c == UINT_MAX)
      return UV_EINVAL;
    if (c != '.')
      if (c != 0x3002)  
        if (c != 0xFF0E)  
          if (c != 0xFF61)  
            continue;
    rc = uv__idna_toascii_label(s, st, &d, de);
    if (rc < 0)
      return rc;
    if (d < de)
      *d++ = '.';
    s = si;
  }
  if (s < se) {
    rc = uv__idna_toascii_label(s, se, &d, de);
    if (rc < 0)
      return rc;
  }
  if (d < de)
    *d++ = '\0';
  return d - ds;  
}

