bool SecureSocket::verify_cert_fingerprint(const barrier::fs::path& fingerprint_db_path)
{
    barrier::FingerprintData fingerprint_sha1, fingerprint_sha256;
    try {
        auto* cert = SSL_get_peer_certificate(m_ssl->m_ssl);
        fingerprint_sha1 = barrier::get_ssl_cert_fingerprint(cert,
                                                             barrier::FingerprintType::SHA1);
        fingerprint_sha256 = barrier::get_ssl_cert_fingerprint(cert,
                                                               barrier::FingerprintType::SHA256);
    } catch (const std::exception& e) {
        LOG((CLOG_ERR "%s", e.what()));
        return false;
    }
    LOG((CLOG_NOTE "server fingerprint (SHA1): %s (SHA256): %s",
         barrier::format_ssl_fingerprint(fingerprint_sha1.data).c_str(),
         barrier::format_ssl_fingerprint(fingerprint_sha256.data).c_str()));
    LOG((CLOG_NOTE "fingerprint_db_path: %s", fingerprint_db_path.u8string().c_str()));
    barrier::FingerprintDatabase db;
    db.read(fingerprint_db_path);
    if (!db.fingerprints().empty()) {
        LOG((CLOG_NOTE "Read %d fingerprints from: %s", db.fingerprints().size(),
             fingerprint_db_path.u8string().c_str()));
    } else {
        LOG((CLOG_NOTE "Could not read fingerprints from: %s",
             fingerprint_db_path.u8string().c_str()));
    }
    if (db.is_trusted(fingerprint_sha256)) {
        LOG((CLOG_NOTE "Fingerprint matches trusted fingerprint"));
        return true;
    } else {
        LOG((CLOG_NOTE "Fingerprint does not match trusted fingerprint"));
        return false;
    }
}

void ComputeAsyncImpl(OpKernelContext* c, CollectiveExecutor* col_exec,
                      DoneCallback done) override {
  auto output_shape = c->input(0).shape();
  OP_REQUIRES_ASYNC(c, output_shape.dims() > 0,
                    errors::InvalidArgument("input should have rank > 0, ",
                                            "recieved ", output_shape.dims()),
                    done);
  output_shape.set_dim(
      0, output_shape.dim_size(0) * col_params_->group.group_size);
  col_params_->instance.shape = output_shape;
  if (c->mutable_output(0) == nullptr) {
    Tensor* output = nullptr;
    OP_REQUIRES_OK_ASYNC(
        c, c->allocate_output(0, col_params_->instance.shape, &output), done);
  }
  if (!CanProceedWithCompute(c, col_exec, done)) return;
  auto actual_done = [c, col_params = col_params_, done](const Status& s) {
    VLOG(1) << "CollectiveGatherOpKernel ExecuteAsync done for collective "
            << c->op_kernel().name() << " device " << c->device()->name()
            << " group " << col_params->group.group_key << " instance "
            << col_params->instance.instance_key << " status " << s;
    col_params->Unref();
    OP_REQUIRES_OK_ASYNC(c, s, done);
    done();
  };
  VLOG(1) << "CollectiveGatherOpKernel ExecuteAsync start for collective "
          << col_params_->name << " device " << c->device()->name()
          << " group " << col_params_->group.group_key << " instance "
          << col_params_->instance.instance_key;
  col_params_->Ref();
  col_exec->ExecuteAsync(c, col_params_, GetCollectiveKey(c), actual_done);
}

int jffs2_set_acl(struct inode *inode, struct posix_acl *acl, int type)
{
	int rc, xprefix;
	switch (type) {
	case ACL_TYPE_ACCESS:
		xprefix = JFFS2_XPREFIX_ACL_ACCESS;
		if (acl) {
			umode_t mode = inode->i_mode;
			rc = posix_acl_equiv_mode(acl, &mode);
			if (rc < 0)
				return rc;
			if (inode->i_mode != mode) {
				struct iattr attr;
				attr.ia_valid = ATTR_MODE | ATTR_CTIME;
				attr.ia_mode = mode;
				attr.ia_ctime = CURRENT_TIME_SEC;
				rc = jffs2_do_setattr(inode, &attr);
				if (rc < 0)
					return rc;
			}
			if (rc == 0)
				acl = NULL;
		}
		break;
	case ACL_TYPE_DEFAULT:
		xprefix = JFFS2_XPREFIX_ACL_DEFAULT;
		if (!S_ISDIR(inode->i_mode))
			return acl ? -EACCES : 0;
		break;
	default:
		return -EINVAL;
	}
	rc = __jffs2_set_acl(inode, xprefix, acl);
	if (!rc)
		set_cached_acl(inode, type, acl);
	return rc;
}

int nfc_activate_target(struct nfc_dev *dev, u32 target_idx, u32 protocol)
{
	int rc;
	struct nfc_target *target;
	pr_debug("dev_name=%s target_idx=%u protocol=%u\n",
		 dev_name(&dev->dev), target_idx, protocol);
	device_lock(&dev->dev);
	if (!device_is_registered(&dev->dev)) {
		rc = -ENODEV;
		goto error;
	}
	if (dev->active_target) {
		rc = -EBUSY;
		goto error;
	}
	target = nfc_find_target(dev, target_idx);
	if (target == NULL) {
		rc = -ENOTCONN;
		goto error;
	}
	rc = dev->ops->activate_target(dev, target, protocol);
	if (!rc) {
		dev->active_target = target;
		dev->rf_mode = NFC_RF_INITIATOR;
		if (dev->ops->check_presence && !dev->shutting_down)
			mod_timer(&dev->check_pres_timer, jiffies +
				  msecs_to_jiffies(NFC_CHECK_PRES_FREQ_MS));
	}
error:
	device_unlock(&dev->dev);
	return rc;
}

