rpcap_remoteact_getsock(const char *host, int *error, char *errbuf)
{
	struct activehosts *temp;			
	struct addrinfo hints, *addrinfo, *ai_next;	
	int retval;
	addrinfo = NULL;
	memset(&hints, 0, sizeof(struct addrinfo));
	hints.ai_family = PF_UNSPEC;
	hints.ai_socktype = SOCK_STREAM;
	retval = sock_initaddress(host, NULL, &hints, &addrinfo, errbuf,
	    PCAP_ERRBUF_SIZE);
	if (retval != 0)
	{
		*error = 1;
		return NULL;
	}
	temp = activeHosts;
	while (temp)
	{
		ai_next = addrinfo;
		while (ai_next)
		{
			if (sock_cmpaddr(&temp->host, (struct sockaddr_storage *) ai_next->ai_addr) == 0)
			{
				*error = 0;
				freeaddrinfo(addrinfo);
				return temp;
			}
			ai_next = ai_next->ai_next;
		}
		temp = temp->next;
	}
	if (addrinfo)
		freeaddrinfo(addrinfo);
	*error = 0;
	return NULL;
}

